#!/bin/sh

# Script for wrapping ghidra to MacOs bundle app.
# NOT TESTED WITH M1+
# ghidra 10.x requaries JDK 17+ (64-bit)
#   https://www.oracle.com/java/technologies/downloads/#jdk19-mac
# Not works for macos13+

exiterror(){
    echo "** Error: $1" >&2
    exit 1
}

animate(){
    "$@"  > /dev/null 2>&1 &
    pid=$!
    spin='-\|/'
    i=0
    while kill -0 $pid 2>/dev/null
    do
    i=$(( (i+1) %4 ))
    printf "\r${spin:$i:1}"
    sleep .1
    done
    printf "\r"
}

echo "[[ Ghidra to MacOS Bundle ]]"

java -version > /dev/null 2>&1 || { 
    echo "JDK Installing..."
    
    # x64 DMG Installer: 176.92 MB,  
    DMG_URL_JRE="https://download.oracle.com/java/19/latest/jdk-19_macos-x64_bin.dmg"
    
    DMG_PATH="/tmp/jdk-19_bin.dmg"
    if [[ $(uname -m) == 'arm64' ]]; then
        # Arm 64 DMG Installer: 175.07 MB
        DMG_URL_JRE="https://download.oracle.com/java/19/latest/jdk-19_macos-aarch64_bin.dmg"
    fi

    echo "Downloading JDK: ${DMG_URL_JRE}"
    curl -# -C - -L "${DMG_URL_JRE}" -o "${DMG_PATH}"

    echo "Mounting ${DMG_PATH}"
    animate hdiutil attach -noverify  -quiet "${DMG_PATH}" || exiterror "Unable mount JDK DMG"
    
    JRE_VOLUME_PATH="$( hdiutil info | grep JDK | sed -E 's/.+(\/Vol.+)/\1/' )"
    [ -n "${JRE_VOLUME_PATH}" ] || exiterror "Unable to get mounted JDK Volume path ${JRE_VOLUME_PATH}"

    echo "Installing pkg with !sudo! ${DMG_PATH}"

    sudo installer -pkg "${JRE_VOLUME_PATH}/"*.pkg -target /

    echo "Detaching ${JRE_VOLUME_PATH}"
    animate hdiutil detach "${JRE_VOLUME_PATH}" > /dev/null 2>&1
}


[ -n "$( /usr/libexec/java_home -v 19 --exec javac -version )" > /dev/null 2>&1 ] || exiterror "Unable to install JDK. Try manually.\n https://www.oracle.com/java/technologies/downloads/#jdk19-mac"

echo "Installing Ghidra"
URL_TO_ZIP="$(curl -s https://api.github.com/repos/NationalSecurityAgency/ghidra/releases/latest | grep browser_download_url | cut -d'"' -f 4)"

echo "URL: \n${URL_TO_ZIP}"

if [ -z "${URL_TO_ZIP}" ]; then
    echo "** ERROR: Latest URL not detected." >&2
    exit 1
fi

VERSION="$(echo "${URL_TO_ZIP}" | sed -E 's/.+Ghidra_([0-9\.]+)_build.+/\1/')"
echo "Downloading version: ${VERSION}"
curl -# -C - -L "${URL_TO_ZIP}" -o /tmp/latest_ghidra.zip

mkdir -p "Ghidra.app/Contents/MacOS"

echo "Extracting files"
animate unzip /tmp/latest_ghidra.zip -d "Ghidra.app/Contents/MacOS"
mv "Ghidra.app/Contents/MacOS/"* "Ghidra.app/Contents/MacOS/ghidra/"
rm /tmp/latest_ghidra.zip

echo "Creating app bundle"
cat <<EOF > "Ghidra.app/Contents/Info.plist"
<?xml version="1.0" encoding="UTF-8"?>
<!DOCTYPE plist PUBLIC "-//Apple//DTD PLIST 1.0//EN" "http://www.apple.com/DTDs/PropertyList-1.0.dtd">
<plist version="1.0">
<dict>
	<key>CFBundleAllowMixedLocalizations</key>
	<true/>
	<key>CFBundleDevelopmentRegion</key>
	<string>English</string>
	<key>CFBundleExecutable</key>
	<string>ghidra/ghidraRun</string>
	<key>CFBundleIconFile</key>
	<string>applet</string>
	<key>CFBundleIdentifier</key>
	<string>com.NationalSecurityAgency.Ghidra</string>
	<key>CFBundleInfoDictionaryVersion</key>
	<string>6.0</string>
	<key>CFBundleName</key>
	<string>Ghidra</string>
	<key>CFBundlePackageType</key>
	<string>APPL</string>
	<key>CFBundleShortVersionString</key>
	<string>${VERSION}</string>
	<key>CFBundleSignature</key>
	<string>aplt</string>
	<key>LSMinimumSystemVersionByArchitecture</key>
	<dict>
		<key>x86_64</key>
		<string>10.6</string>
	</dict>
	<key>LSRequiresCarbon</key>
	<true/>
</dict>
</plist>
EOF

mkdir -p "Ghidra.app/Contents/Resources/"

# restore icons
printf "" | base64 -d | gunzip > "Ghidra.app/Contents/Resources/applet.icns"

echo "Done"
